import React, { Component } from 'react';
import PropTypes from 'prop-types';
// import AppIcon from '../images/ori_logo.png';
import Typography from '@material-ui/core/Typography';
import appLogo from '../../../../../images/ori_logo.png';
// import styles from '../styles';
import { Bounce, Shake, FadeIn, FadeOut, Flash } from 'react-motions' //https://github.com/raphamorim/react-motions


//mui studd
import Grid from '@material-ui/core/Grid'
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import MuiPhoneNumber from "material-ui-phone-number";
import Select from '@material-ui/core/Select';
import MenuItem from '@material-ui/core/MenuItem';
import FormControl from '@material-ui/core/FormControl';
import PanToolIcon from '@material-ui/icons/PanTool';
import Radio from '@material-ui/core/Radio';
import RadioGroup from '@material-ui/core/RadioGroup';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Switch from '@material-ui/core/Switch';
import InputLabel from '@material-ui/core/InputLabel';
import EmojiEmotionsIcon from '@material-ui/icons/EmojiEmotions';
import LinearProgress from '@material-ui/core/LinearProgress';
import CircularProgress from '@material-ui/core/CircularProgress';

//Redux stuf
import { connect } from 'react-redux';
import { mergeAdminWithOrg } from '../../../../../redux/actions/adminActions'

const Link = require("react-router-dom").Link

const styles = {
    container: {
        // backgroundColor: "black",
        // width: '320px',
        height: '320px',
        margin: "5% 40%"
    },
    ladderLoading: {
        // width: "",
        // height: "500px"
    }
}


const loadingAdminPage = () => {
        // const p =    setInterval(() => <p style={{fontSize:"100px"}}>Loading</p>, 1000)
        const classes = useStyles();
        const [completed, setCompleted] = React.useState(0);

        React.useEffect(() => {
            function progress() {
            setCompleted(prevCompleted => (prevCompleted >= 100 ? 0 : prevCompleted + 10));
            }

            const timer = setInterval(progress, 1000);
            return () => {
            clearInterval(timer);
            };
        }, []);


    return (
        <div style={styles.container}>
            {/* <LinearProgress variant="determinate" value={75} />
            <LinearProgress variant="determinate" value={10} color="secondary" /> */}
                    <CircularProgress variant="static" value={5} />

        </div>

    )

}


export default loadingAdminPage
